import UsuarioIndividual from './UsuarioIndividual';
/* Creación de componente de react*/
function ListaUsuarios(){
    return(
        <div>
            <h2>Lista de usuarios</h2>
            <UsuarioIndividual/>
        </div>
    )
}

export default ListaUsuarios
